import React from "react"
import { ReactDOM } from "react"
import UseFetchExchange2 from "./useFetchExchange";
import UseFetchCurrencies from "./useFetchCurrencies";

export default function TestFetch() {
    const data = UseFetchExchange2('https://openexchangerates.org/api/latest.json?app_id=01341f5261444649a612793df73c7130').then(
        data => console.log(data)
    )
    console.log('test: ' + data);

    return (
        <>
            <h1>{data}</h1>
            <ul>
                {data && data.map(
                    (currency, index) => {
                        return (
                            <li key={index}>{currency}</li>
                        )
                    }
                )}
            </ul>
        </>
    )
}
